import style from './Cards.module.css';



function Cards({characters, onClose}) {
   
   return ( 
      <div className={style.Cards}>
         {
            characters.map(({id, name, species, gender, image}) => { // destructuring
               return <Card
               key={id}
               name={name}
               species={species}
               gender={gender}
               image={image}
               onClose={() => onClose(id)}
               />
            })
         }
      </div>
   )
}

export default Cards;
